import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { Link } from "react-router-dom";
import { useState } from "react";

import "./Header.css";

export default function Header() {

  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const handleDropdownToggle = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  return (
    <Navbar
      variant="dark"
      expand="lg"
      className="animated-border-container animated-border"
    >
      <Container>
        <Navbar.Brand href="#home">God_&_Light</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home" className="">
              <span className="abc">Astakas</span>
              <ul className="dropdown-linkx">
                <li className="ll"> <Link to="astakas"> Aaa </Link> </li>
                <li className="ll"> <Link to="astakas" > Aaa </Link> </li>
                <li className="ll"> <Link to="astakas" > Aaa </Link> </li>
                <li className="ll"> <Link to="astakas" > Aaa </Link> </li>
              </ul>
            </Nav.Link>
            <Nav.Link href="#home">Kavachas</Nav.Link>
            <Nav.Link href="#link">Stotras</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}
